import React, { useState } from "react";
import { Link } from "react-router-dom";
import axios from 'axios';

function Signup() {
    const [values, setValues] = useState({
        name:"",
        email:"",
        password:"",
    });
    const handleInput = (event)=>{
        setValues(prev =>({
            ...prev, [event.target.name]: [event.target.value]
        }))
        console.log(values)
    }
    
    const handleSubmit =(event)=>{
        event.preventDefault();
        axios.post('http://localhost:8081/signup',values).then(res=>consol.log(res))

    }
  return (
    <div>
      <form action="" onSubmit={handleSubmit}>
        <input type="text" placeholder="name" onChange={handleInput} name="name" />
        <input type="email" placeholder="Enter your email address" onChange={handleInput} name="email" />
        <input type="password" placeholder="Enter your password" onChange={handleInput} name="password" />
        <button>Signup</button>
        <Link to="/">Login</Link>
      </form>
    </div>
  );
}

export default Signup;
